import './App.css';

function RoundRect({title, ID, timing}) {
  return (
    <div className = 'block'>
      <p className="block-header">{ID}</p>

      <div className='row spread'> 

        <p>{timing}</p>
      </div>

      <p className = "block-subheader">{title}</p>

    </div>
  );
}


export default function App() {
  return (
    <>
      <div className="App">
        <RoundRect title = "this is my test title for a course" ID = "CMSC131" timing = "1PM-3PM" />
      </div>
    </>
  );
}
